    render(){
        return (
            <div className='admin'>
                <form>
                    <input type="file" name="file" accept="image/*"/>
                    <input type="text" name="name"/>
                    <input type="text" name="cost"/>
                    <input type="text" name="descript"/>
                    <button></button>
                </form>
            </div>      
        )
    }
}
